import React, { useEffect, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper.min.css';
import SwiperCore, { Autoplay } from 'swiper';
import { isMobile } from '../../utils/device';
import { SwiperCloseButton } from '../../components/icon/Common';

SwiperCore.use([Autoplay]);

export default function AdSwiper() {
  const [closeStatus, setCloseStatus] = useState(true);
  useEffect(() => {
    const popupSwiper = localStorage.getItem('ad-announcement');
    if (popupSwiper == '14') {
      setCloseStatus(true);
    } else {
      setCloseStatus(false);
    }
  }, []);
  const closePop = (e: any) => {
    localStorage.setItem('ad-announcement', '14');
    e.stopPropagation();
    setCloseStatus(true);
  };
  const is_mobile = isMobile();
  return (
    <>
      {closeStatus ? null : (
        <div>
          <Swiper
            spaceBetween={30}
            centeredSlides={true}
            autoHeight={false}
            autoplay={{
              delay: 10000,
              disableOnInteraction: false,
            }}
            loop
          >
            <SwiperSlide>
              <div
                onClick={closePop}
                className="flex justify-end items-center absolute top-0 right-0 cursor-pointer z-10"
              >
                <SwiperCloseButton className="cursor-pointer"></SwiperCloseButton>
              </div>
              <div
                className="relative cursor-pointer"
                onClick={() => {
                  window.open('/v2farms/4179-r');
                }}
              >
                {is_mobile ? <StablecoinFARMMobile /> : <StablecoinFARM />}
              </div>
            </SwiperSlide>
            <SwiperSlide>
              <div
                onClick={closePop}
                className="flex justify-end items-center absolute top-0 right-0 cursor-pointer z-10"
              >
                <SwiperCloseButton className="cursor-pointer"></SwiperCloseButton>
              </div>
              <div
                className="relative cursor-pointer"
                onClick={() => {
                  window.open('/v2farms/4514-r');
                }}
              >
                {is_mobile ? <FRAXUSDCFARMMobile /> : <FRAXUSDCFARM />}
              </div>
            </SwiperSlide>
            <SwiperSlide>
              <div
                onClick={closePop}
                className="flex justify-end items-center absolute top-0 right-0 cursor-pointer z-10"
              >
                <SwiperCloseButton className="cursor-pointer"></SwiperCloseButton>
              </div>
              <div
                className="relative cursor-pointer"
                onClick={() => {
                  window.open('https://www.deltatrade.ai/activity/home');
                }}
              >
                {is_mobile ? <DeltaMobile /> : <DeltaPC />}
              </div>
            </SwiperSlide>
          </Swiper>
        </div>
      )}
    </>
  );
}
function StablecoinFARM() {
  return (
    <img
      alt=""
      src="data:image/png;base64,"
    />
  );
}
function StablecoinFARMMobile() {
  return (
    <img
      alt=""
      src="data:image/png;base64,"
    />
  );
}
function FRAXUSDCFARM() {
  return (
    <img
      alt=""
      src="data:image/png;base64,"
    />
  );
}
function FRAXUSDCFARMMobile() {
  return (
    <img
      alt=""
      src="data:image/png;base64,"
    />
  );
}

function DeltaMobile() {
  return (
    <img
      src="data:image/png;base64,"
      alt=""
    />
  );
}

function DeltaPC() {
  return (
    <img
      src="data:image/png;base64,"
      alt=""
    />
  );
}
